g width=\"1024\" height=\"737\" src=\"http://10.6.221.8/wp-content/uploads/2019/11/stephen-dawson-qwtCeJ5cLYs-unsplash-1024x737.jpg\" alt=\"\" srcset=\"http://10.6.221.8/wp-content/uploads/2019/11/stephen-dawson-qwtCeJ5cLYs-unsplash-1024x737.jpg 1024w, http://10.6.221.8/wp-content/uploads/2019/11/stephen-dawson-qwtCeJ5cLYs-unsplash-300x216.jpg 300w, http://10.6.221.8/wp-content/uploads/2019/11/stephen-dawson-qwtCeJ5cLYs-unsplash-768x553.jpg 768w, http://10.6.221.8/wp-content/uploads/2019/11/stephen-dawson-qwtCeJ5cLYs-unsplash-1536x1105.jpg 1536w, http://10.6.221.8/wp-content/uploads/2019/11/stephen-dawson-qwtCeJ5cLYs-unsplash-2048x1474.jpg 2048w, http://10.6.221.8/wp-content/uploads/2019/11/stephen-dawson-qwtCeJ5cLYs-unsplash-scaled.jpg 1600w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" />                            </figure>\n            <h2>Asset Monitor</h2>\n                    <p>Monitor Network Attached Assets</p>\n                                <a href=\"http://10.6.221.13\" target=\"_blank\" rel=\"noopener noreferrer\"> Check Assets</a>','Home','','publish','closed','closed','','home','','','2020-01-29 19:15:52','2020-01-29 19:15:52','',0,'http://10.6.221.8/?page_id=2',0,'page','',0),(3,1,'2019-11-29 14:58:41','2019-11-29 14:58:41','<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Our website address is: http://10.6.221.8.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What personal data we collect and why we collect it</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comments</h3><!-- /wp:heading --><!-- wp:paragraph --><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Media</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contact forms</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Embedded content from other websites</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Analytics</h3><!-- /wp:heading --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where we send your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Your contact information</h2><!-- /wp:heading --><!-- wp:heading --><h2>Additional information</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>How we protect your data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What data breach procedures we have in place</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What third parties we receive data from</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What automated decision making and/or profiling we do with user data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Industry regulatory disclosure requirements</h3><!-- /wp:heading -->','Privacy Policy','','draft','closed','open','','privacy-policy','','','2019-11-29 14:58:41','2019-11-29 14:58:41','',0,'http://10.6.221.8/?page_id=3',0,'page','',0),(11,1,'2019-11-29 15:20:09','2019-11-29 15:20:09','','1547_logo_large','','inherit','open','closed','','1547_logo_large','','','2019-11-29 15:20:09','2019-11-29 15:20:09','',0,'http://10.6.221.8/wp-content/uploads/2019/11/1547_logo_large.png',0,'attachment','image/png',0),(13,1,'2019-11-29 15:26:49','2019-11-29 15:26:49','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pia coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://10.6.221.8/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','inherit','closed','closed','','2-revision-v1','','','2019-11-29 15:26:49','2019-11-29 15:26:49','',2,'http://10.6.221.8/?p=13',0,'revision','',0),(15,1,'2019-11-29 15:39:53','2019-11-29 15:39:53','','The-116-BistroInnerpage-Banner_09.jpg','','inherit','open','closed','','the-116-bistroinnerpage-banner_09-jpg','','','2019-11-29 15:39:53','2019-11-29 15:39:53','',0,'http://10.6.221.8/wp-content/uploads/2019/11/The-116-BistroInnerpage-Banner_09.jpg',0,'attachment','image/jpeg',0),(16,1,'2019-11-29 15:39:57','2019-11-29 15:39:57','','The-116-BistroInnerpage-Banner_05.jpg','','inherit','open','closed','','the-116-bistroinnerpage-banner_05-jpg','','','2019-11-29 15:39:57','2019-11-29 15:39:57','',0,'http://10.6.221.8/wp-content/uploads/2019/11/The-116-BistroInnerpage-Banner_05.jpg',0,'attachment','image/jpeg',0),(17,1,'2019-11-29 15:40:02','2019-11-29 15:40:02','<a href=\"https://the116bistro.com/pinnacle-room/\" data-elementor-open-lightbox=\"\">\n							<img width=\"1920\" height=\"800\" src=\"http://10.6.221.8/wp-content/uploads/2019/11/The-116-BistroInnerpage-Banner_09.jpg\" alt=\"\" srcset=\"http://10.6.221.8/wp-content/uploads/2019/11/The-116-BistroInnerpage-Banner_09.jpg 1920w, http://10.6.221.8/wp-content/uploads/2019/11/The-116-BistroInnerpage-Banner_09-300x125.jpg 300w, http://10.6.221.8/wp-content/uploads/2019/11/The-116-BistroInnerpage-Banner_09-1024x427.jpg 1024w, http://10.6.221.8/wp-content/uploads/2019/11/The-116-BistroInnerpage-Banner_09-768x3